DROP TABLE IF EXISTS `tbl_ticket_details`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tbl_ticket_details` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ticket_id` int(11) DEFAULT NULL,
  `product_id` int(11) DEFAULT NULL,
  `qty` int(11) DEFAULT NULL,
  `amt` decimal(10,0) DEFAULT NULL,
  `price` decimal(10,0) DEFAULT NULL,
  `status` varchar(11) DEFAULT NULL,
  `created_at` datetime NOT NULL,
  `modified_at` datetime NOT NULL,
  `usedBy` varchar(45) NOT NULL DEFAULT 'Admin',
  `remark` varchar(45) DEFAULT NULL,
  `version` int(11) DEFAULT NULL,
  `refno` varchar(45) DEFAULT NULL,
  `uom` int(11) DEFAULT NULL,
  `client_id` varchar(45) DEFAULT NULL,
  `stand_id` int(11) DEFAULT NULL,
  `discount_amount` decimal(10,2) DEFAULT '0.00',
  `discount_type` varchar(45) DEFAULT 'amount',
  `item_discount` decimal(10,2) DEFAULT '0.00',
  PRIMARY KEY (`id`),
  KEY `fk_ticket_details_idx` (`ticket_id`),
  KEY `fk_ticketD_product_idx` (`product_id`),
  KEY `fk_ticket_uom_idx` (`uom`),
  KEY `fk_ticket_stand_idx` (`stand_id`),
  CONSTRAINT `fk_ticketD_product` FOREIGN KEY (`product_id`) REFERENCES `tbl_product` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_ticket_details` FOREIGN KEY (`ticket_id`) REFERENCES `tbl_tickets` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_ticket_stand` FOREIGN KEY (`stand_id`) REFERENCES `tbl_stands` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_ticket_uom` FOREIGN KEY (`uom`) REFERENCES `tbl_uom` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=540 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

